package com.nishant.practice;

import java.util.Scanner;

public class ReverseNumberPrint {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int n = sc.nextInt();
		int i= 0;
		while (n >= i){
			System.out.print(n+" ");
			n = n-1;
			
		}

	}

}
